import React from "react";
import { ProductInterface } from "./Interfaces/ProductInterface";

interface Props {
  product: ProductInterface;
}

const ProductComponent: React.FC<Props> = ({ product }) => {
  return (
    <div className="rectangle position-relative bg-white rounded p-3">
      <div className="d-flex justify-content-between align-items-center">
        <div>
          <p>{product.car_model}</p>
          <p>{product.prod_year} წ</p>
          <p>{product.location_id}</p>
          <p>{product.checked}</p>
        </div>
        <div>
          <img
            className="img-fluid rounded"
            src={`https://static.my.ge/myauto/photos/${product.photo}/thumbs/${product.car_id}_1.jpg?v=${product.photo_ver}`}
            alt={product.car_model}
          />
        </div>
      </div>
      <div className="d-flex justify-content-between">
        <div>
          <p>{product.engine_volume}</p>
          <p>{product.car_run_km} კმ</p>
        </div>
        <div>
          <p>{product.gear_type_id}</p>
          <p>{product.right_wheel}</p>
        </div>
      </div>
      <div>
        <p>{product.views}</p>
      </div>
    </div>
  );
};

export default ProductComponent;
